snippet.textDisplay:
@Marcelo Santos só que Brasil está representando 27% das mortes por covid no mundo enquanto sua população representa 2% da população mundial.
 Podem ter países piores, mas não muda o fato de que o Brasil tá na pior também. 
 Lockdown é necessário, para economia e para a vida.

